import React, { Component, Fragment } from "react";
import { MDBListGroup, MDBListGroupItem,MDBInput,MDBCol,MDBCard,MDBContainer, MDBRow, MDBCardBody, MDBCardHeader, MDBMedia, MDBCardImage, MDBBadge } from "mdbreact";
import TagList from "../components/MainLayout/TagList.js";
import PostList from "../components/MainLayout/PostList.js";
import Advertisement from "../components/MainLayout/Advertisement.js";
import Subscription from "../components/MainLayout/Subscription.js";
import PopularPosts from "../components/MainLayout/PopularPosts";

class MainLayout extends Component {


render() {
  return (
    <Fragment className="mt-5 pt-5">
      <MDBContainer className="container">
          <Fragment className="mt-4">
            <MDBRow className="row">

            <PostList/>
              <MDBCol className="col-md-4 mb-4">

                        <TagList/>
                        <Advertisement/>
                        <Subscription/>
                        <PopularPosts/>






              </MDBCol>


            </MDBRow>

          </Fragment>
      </MDBContainer>
    </Fragment>
    )
  }
}

export default MainLayout;
